%[text] %[text:anchor:T_40DC22DC] # **Signal Trace Chart Examples**
%[text] **Overview**
%[text] The `SignalTraceChart` organizes the vertical display of multiple signal channels. The chart data comprises a numeric vector `Time` and a numeric matrix `SignalData`. Each column of `SignalData` is interpreted as a separate channel. To organize the vertical display of the signals, the chart normalizes each channel to have zero mean and unit standard deviation, then plots each signal against time in a vertical stack, leaving a small gap between each successive pair of signals. Signals may be inserted or removed from the chart by modifying the `SignalData` property. The time vector is changed by modifying the `Time` property.
%[text] ![SignalTraceChart.png](text:image:7b0e)
%[text] **Documentation**
%[text] See also:
%[text] - [**`stackedplot`**](<matlab: doc("stackedplot")>): An existing MATLAB chart for creating a stacked plot of several variables with a common x-axis \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_8FF27B67] ## Create data for the chart: time and signals.
%[text] First, define a time vector from 0 to $6\\pi$containing 5000 elements.
t = linspace( 0, 6 * pi, 5000 ).';
%[text] Next, define various signals:
%[text] - $y\_1$ is a discrete signal taking values $0$, $-1$ and $1$;
%[text] - $y\_2$ is a sine wave;
%[text] - $y\_3$ is a cosine wave;
%[text] - $y\_4$ is the product of a sine wave and a cosine wave which have different frequencies. \
y1 = [zeros( 1000, 1 ); ones( 500, 1 );
    zeros( 500, 1 ); (-1) * ones( 500, 1 );
    ones( 1000, 1 ); zeros( 1000, 1 );
    ones( 500, 1 )];
y2 = sin( t );
y3 = cos( t );
y4 = 2 * sin( 2 * t ) .* cos( 3 * t );
%[text] Join the signals $y\_1$, $y\_2$, $y\_3$ and $y\_4$ into a matrix with four columns.
signals = [y1, y2, y3, y4];
%%
%[text] %[text:anchor:H_EDAB43D0] ## Create a figure for the chart.
f = exampleFigure( "Name", "SignalTraceChart Example" ); %[output:027ea32d]
%%
%[text] %[text:anchor:H_7DB7FD1E] ## Create the chart.
STC = SignalTraceChart( "Parent", f, ... %[output:group:8b28fc5f] %[output:027ea32d]
    "Time", t, ... %[output:027ea32d]
    "SignalData", signals, ... %[output:027ea32d]
    "XAxisFontSize", 12 ); %[output:group:8b28fc5f] %[output:027ea32d]
%%
%[text] %[text:anchor:H_50FC111A] ## Customize the chart appearance.
xlabel( STC, "Time (s)", "FontSize", 14 ) %[output:6aea5c0a]
ylabel( STC, "Traces", "FontSize", 14) %[output:6aea5c0a]
title( STC, "Signal Trace Chart", "FontSize", 16 ) %[output:6aea5c0a]
%%
%[text] %[text:anchor:H_91A54037] ## Change the chart data.
STC.Time = 5 + STC.Time; %[output:2a18262e]
STC.SignalData = [y1, y3]; %[output:2a18262e]
%%
